	private static void convertUglyJsonToPrettyJson(String sourceFilePath,String targetFilePath) throws FileNotFoundException {
		
		System.out.println("sourceFilePath : "+sourceFilePath+" targetFilePath : "+targetFilePath);
		
		String uglyJSONString =readTxtFile(sourceFilePath);
		String prettyJsonString = prettyPrint(uglyJSONString);
		PrintStream ps=new PrintStream(new File(targetFilePath));
		ps.println(prettyJsonString);
	}
	
	private static String prettyPrint(String uglyJSONString) {
		Gson gson = new GsonBuilder().setPrettyPrinting().create();
		JsonParser jp = new JsonParser();
		JsonElement je = jp.parse(uglyJSONString);
		String prettyJsonString = gson.toJson(je);
		
		return prettyJsonString;
	}
	
	private static String readTxtFile(String fileName) throws FileNotFoundException {
		String result="";
		
		// pass the path to the file as a parameter 
	    File file = 
	      new File(fileName); 
	    Scanner sc = new Scanner(file); 
	    
	    StringBuffer sb= new StringBuffer();
	  
	    while (sc.hasNextLine()) 
	      sb.append(sc.nextLine());
	    
	    result=sb.toString();
		
		return result;
	}

	private static void first(String[] args) {
		System.out.println("Hello");
		int sum = 0;

		int initialDigits = 0;
		try {
			if (args != null && args.length > 0) {
				initialDigits = Integer.parseInt(args[0]);
			}

		} catch (NumberFormatException e) {

			// e.printStackTrace();
		}

		if (args == null || initialDigits <= 0) {
			System.out.println("Please provide initial digits up to which you need to sum?");

			Scanner myObj = new Scanner(System.in);

			System.out.println("Enter value : ");
			String initDigits = myObj.nextLine();

			initialDigits = 0;
			try {
				initialDigits = Integer.parseInt(initDigits);
			} catch (NumberFormatException e) {
				System.out.println("Input is not an Integer!! exiting.");
				myObj.close();
				System.exit(0);
				// e.printStackTrace();
			}

			// return;
		}

		for (int i = 0; i <= initialDigits; i++) {
			sum += i;
		}

		System.out.println("Sum of first " + initialDigits + " digits is : " + sum);
	}

